/* eslint-disable */

import ref from "./Body";

function Breed(props) {
  if (props.type == 0) {
    return <div></div>;
  }
  return (
    <div class="breedAreaBG">
      <h1>{props.type}을 선택하셨습니다.</h1>
    </div>
  );
}

export default Breed;
